import React from "react";
import SingUp from './signup';
import LogIn from './login';
function Home() {
    
  return (
    <>
        <div>
          <SingUp></SingUp>
        </div>
        <div>
          <LogIn></LogIn>
        </div>
    </>
  );
}

export default Home;
